import React from "react";
import chercher from "../icons/chercher.svg";

const Navbar = () => {
  return (
    <div>
      <div>
        <input type="text" className="recherche" placeholder="Recherche" />
        <img src={chercher} alt="" />
      </div>
    </div>
  );
};

export default Navbar;
